import { BrowserRouter, Route } from 'react-router-dom';
import './App.scss';
import { About } from './pages/About';
import { Home } from './pages/Home';


function App() {
  return (
    <BrowserRouter>
      <div className="container pt-4">
        <Route path='/' exact component={Home} />
        <Route path='/about' component={About} />
      </div>
    </BrowserRouter>
  );
}

export default App;
